Al incio no sabia de lo que trataría este curso ni el manejo que tendría sobre el, me asusto pero al mismo tiempo me emociono ver el temario que ofrecía.
Tienes que saber que la carga de trabajos se junta con las actividades diarias personales pero al final te sentirás bien de saber que con esfuerzo y un poco de organización terminas todos los pendientes y más si es que necesitabas estos tipos de conocimientos para mejorar tus habilidades como desarrollador.
